import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../node_modules/bootstrap/dist/js/bootstrap.min.js";
import "./index.css";
import Header from "./Header";
import Home from "./Home";
import { Switch , Route, Redirect } from "react-router-dom";
import Footer from "./Footer";
import Card from "./Card";
import Carddata from "./Carddata";

const App = () => {
  return (
    <div>
      <Header />
        <Switch>
            <Route exact path="/home" component={ Home } />
            <Route exact path="/orignal-artworks" component={ Card } />
            <Route exact path="/merchandise" component={ Card } />
            <Route exact path="/customised-gifts" component={ Card } />
            <Route exact path="/t-shirts" component={ Card } />
            <Route exact path="/card-data" component={ Carddata } />
            <Redirect to="/home" />
        </Switch>
      <Footer />
    </div>
      );
};

export default App;
